/*
 * @Author: your name
 * @Date: 2021-11-02 14:29:58
 * @LastEditTime: 2022-03-23 08:25:05
 * @LastEditors: Please set LastEditors
 * @Description: 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 * @FilePath: \bl-device-manage\src\routes\HomeRouter\configs.js
 */
import React from 'react';
import LoadingComponent from 'Components/ComponentLoading';
import Loadable from 'react-loadable';


// 首页
const HomePage = Loadable({
  loader: () => import('layouts/HomeLayout/HomePage'),
  loading: LoadingComponent
});
// 系统管理
const SystemManage = Loadable({
  loader: () => import('../SystemRouter'),
  loading: LoadingComponent
});
// 基础管理
const BasicManage = Loadable({
  loader: () => import('../BasicRouter'),
  loading: LoadingComponent
});
// 备件管理
const SparepartsManage = Loadable({
  loader: () => import('../SparepartsRouter'),
  loading: LoadingComponent
});
// 统计分析
const StatisticsManage = Loadable({
  loader: () => import('../StatisticsRouter'),
  loading: LoadingComponent
});
//
const WorkManage = Loadable({
  loader: () => import('../WorkRouter'),
  loading: LoadingComponent
});
const DeviceManage = Loadable({
  loader: () => import('../DeviceRouter'),
  loading: LoadingComponent
});
const EditPage = Loadable({
  loader: () => import('layouts/TableEdit'),
  loading: LoadingComponent
});

export {
  HomePage,
  BasicManage, WorkManage,DeviceManage,
  SparepartsManage, StatisticsManage, SystemManage,
  EditPage
};
